import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { jwtDecode } from "jwt-decode";
import { FormControl, FormLabel, Input, Badge, Button } from "@chakra-ui/react";
import {
  Card,
  CardHeader,
  CardBody,
  Grid,
  GridItem,
  Box,
  Container,
  Image,
} from "@chakra-ui/react";
import "./Pages.style.css";
import QuotesImage from "../assets/quotes-bg.jpg";

import { DeleteIcon, EditIcon } from "@chakra-ui/icons";
import { Provider } from "chakra-ui-carousel";
import { LeftButton, RightButton } from "chakra-ui-carousel";

import { Carousel } from "chakra-ui-carousel";

const Dashboard = () => {
  const navigate = useNavigate();

  const [quotes, setQuotes] = useState([]);

  const [tempQuote, setTempQuote] = useState("");

  async function populateQuote() {
    const data = await fetch("http://localhost:1337/api/quote", {
      method: "GET",
      headers: {
        "x-access-token": localStorage.getItem("token"),
      },
    });

    const response = await data.json();

    if (response.status === "ok") {
      setQuotes(response.quotes);
    } else {
      alert(response.error);
    }
  }

  useEffect(() => {
    const token = localStorage.getItem("token");

    if (token) {
      const user = jwtDecode(token);

      if (!user) {
        navigate("/login");
        localStorage.removeItem("token");
      } else {
        populateQuote();
      }
    } else {
      navigate("/login");
    }
  }, []);

  async function createQuote(event) {
    event.preventDefault();
    const newQuote = tempQuote.trim();

    // Check if the new quote already exists
    if (quotes.includes(newQuote)) {
      alert("Duplicate quote. Please enter a different quote.");
      return;
    }

    const data = await fetch("http://localhost:1337/api/quote", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        "x-access-token": localStorage.getItem("token"),
      },
      body: JSON.stringify({
        quote: newQuote,
      }),
    });

    const response = await data.json();
    console.log(response.status);
    if (response.status === "ok") {
      setTempQuote("");
      setQuotes([newQuote, ...quotes]); // Add the new quote to the beginning of the array
    } else {
      alert(response.error);
    }
  }

  async function editQuote(index) {
    const currentQuote = quotes[index];
    const newQuote = prompt("Enter new quote", currentQuote);

    if (newQuote !== null && newQuote.trim() !== "") {
      // Check if the edited quote already exists
      if (quotes.includes(newQuote)) {
        alert("Duplicate quote. Please enter a different quote.");
        return;
      }

      const updatedQuotes = [...quotes];
      updatedQuotes[index] = newQuote;

      // Move the edited quote to the front of the array
      updatedQuotes.unshift(updatedQuotes.splice(index, 1)[0]);

      // Make API request to update the quotes on the server
      const data = await fetch("http://localhost:1337/api/quote", {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          "x-access-token": localStorage.getItem("token"),
        },
        body: JSON.stringify({
          quotes: updatedQuotes,
        }),
      });

      const response = await data.json();
      if (response.status === "ok") {
        setQuotes(updatedQuotes);
      } else {
        alert(response.error);
      }
    } else if (newQuote !== null) {
      // Show an alert if the user entered an empty quote
      alert("Please enter a non-empty quote.");
    }
  }

  async function deleteQuote(index) {
    const updatedQuotes = [...quotes];
    updatedQuotes.splice(index, 1);

    // Make API request to update the quotes on the server
    const data = await fetch("http://localhost:1337/api/quote", {
      method: "PUT",
      headers: {
        "Content-Type": "application/json",
        "x-access-token": localStorage.getItem("token"),
      },
      body: JSON.stringify({
        quotes: updatedQuotes,
      }),
    });

    const response = await data.json();
    if (response.status === "ok") {
      setQuotes(updatedQuotes);
    } else {
      alert(response.error);
    }
  }

  function handleLogout() {
    localStorage.removeItem("token");
    navigate("/login");
  }

  const property = {
    imageUrl: QuotesImage,
    imageAlt: quotes,
    imageWidth: "100%",
    title: quotes,
  };

  const handleFocus = () => setTrackIsActive(true);

  const handleDecrementClick = () => {
    setTrackIsActive(true);
    !(activeItem === positions.length - positions.length) &&
      setActiveItem((prev) => prev - 1);
  };

  const handleIncrementClick = () => {
    setTrackIsActive(true);
    !(activeItem === positions.length - constraint) &&
      setActiveItem((prev) => prev + 1);
  };

  return (
    <div>
      <Container maxW="6xl" color="white">
        <div className="inner-page">
          <Card>
            <CardHeader>
              <div className="header">
                <h1>Create Quote</h1>
                <Button onClick={handleLogout}>Logout</Button>
              </div>
            </CardHeader>
            <CardBody>
              <form onSubmit={createQuote}>
                <FormControl>
                  <FormLabel>Quote</FormLabel>
                  <Input
                    type="text"
                    name="quote"
                    value={tempQuote}
                    onChange={(e) => setTempQuote(e.target.value)}
                    id="quote"
                    placeholder="Enter your quote"
                  />
                  <Input
                    mt={4}
                    cursor={"pointer"}
                    type="submit"
                    value="Get Quote"
                  />
                </FormControl>
              </form>
            </CardBody>
          </Card>
        </div>
        <Card>
          <CardHeader>Your Quotes:</CardHeader>
          <CardBody>
            <Box>
              <Provider>
                <Carousel gap={20}>
                  {quotes.map((quote, index) => (
                    <Box
                      maxW="100%"
                      borderWidth="1px"
                      borderRadius="lg"
                      overflow="hidden"
                      className="image-box"
                    >
                      <Image src={property.imageUrl} alt={quote} width="100%" />

                      <Box p="6" className="Quotes">
                        <Box
                          mt="1"
                          fontWeight="semibold"
                          as="h4"
                          lineHeight="tight"
                          noOfLines={3}
                        >
                          {quote}
                        </Box>
                      </Box>
                      <div className="btn-container">
                        <EditIcon
                          onClick={() => editQuote(index)}
                          w={8}
                          h={8}
                          color="white.500"
                        />

                        <DeleteIcon
                          onClick={() => deleteQuote(index)}
                          w={8}
                          h={8}
                          color="white.500"
                        />
                      </div>
                    </Box>
                  ))}
                </Carousel>
              </Provider>
              <Flex w={`${itemWidth}px`} mt={`${gap / 2}px`} mx="auto">
                <Button
                  onClick={handleDecrementClick}
                  onFocus={handleFocus}
                  mr={`${gap / 3}px`}
                  color="gray.200"
                  variant="link"
                  minW={0}
                >
                  <ChevronLeftIcon boxSize={9} />
                </Button>

                <Progress
                  value={percentage(activeItem, positions.length - constraint)}
                  alignSelf="center"
                  borderRadius="2px"
                  bg="base.d100"
                  flex={1}
                  h="3px"
                  sx={{
                    "> div": {
                      backgroundColor: "gray.400",
                    },
                  }}
                />

                <Button
                  onClick={handleIncrementClick}
                  onFocus={handleFocus}
                  ml={`${gap / 3}px`}
                  color="gray.200"
                  variant="link"
                  zIndex={2}
                  minW={0}
                >
                  <ChevronRightIcon boxSize={9} />
                </Button>
              </Flex>
            </Box>
          </CardBody>
          {/* <CardBody>
            <Grid templateColumns="repeat(2, 1fr)" gap={6}>
              {quotes.map((quote, index) => (
                <GridItem w="100%" h="100%">
